import React from 'react';
import './App.css';
import { Fragment } from 'react';
import { Container } from 'semantic-ui-react';
import {
  Button,
  Form,
  Grid,
  Header,
  Message,
  Segment,
} from 'semantic-ui-react';

function App() {
  return (
    <Fragment>
      <Container>
        <Message>
          Not registered yet? <a href="#">Sign Up</a>
        </Message>
      </Container>
    </Fragment>
  );
}

export default App;
